.mat-expansion-panel,
.mat-expansion-panel:not([class*=mat-elevation-z]) {
    overflow: visible;

    .mat-expansion-panel-header {
        padding: 15px 16px 9px 0;
        border-top: 1px solid #767676;
        border-radius: 0;
        font-family: 'Open Sans';
        font-style: normal;
        font-weight: 700;
        font-size: 14px;
        line-height: 130%;
        color: #191919;

        span {
            display: flex;
            align-items: center;
            gap: 12px;

            svg {
                color: #767676;
                width: 20px;
                height: 20px;
                transition: all 0.2s ease-out;
            }

            span {
                gap: 8px;

                svg {
                    width: 16px;
                    height: 16px;
                }
            }
        }

        &[aria-disabled=true] {
            border-color: #C3C5C9;
