                }
            }
        }

        &:focus-visible {
            outline: 1px solid #5804FF;
            outline-offset: 4px;
        }
    }

    .mat-expansion-panel-content {
        overflow: hidden;
        max-height: 0;
        transition: all 0.3s ease-out;
        .mat-expansion-panel-body {
            padding: 0 16px;
            font-family: 'Open Sans';
            font-style: normal;
            font-weight: 400;
            font-size: 13px;
            line-height: 120%;
            color: #191919;
        }
    }

    .mat-expanded {
        span {
            svg {
                transform: rotate(90deg);
            }
        }
    }
}

.mat-expansion-panel .mat-expanded ~ .mat-expansion-panel-content {
    max-height: 100%;
}

