@use "sass:map";

$theme: "dark", "light";
$background: (
    "light": #005c99,
    "dark": #FFFFFF
);

@each $val in $theme {
    .spinner-#{$val} {
        position: absolute;
        top: 50%;
        left: 50%;
        transform: translate(-50%, -50%);
        display: flex;
        align-items: center;

        span {
            height: 20px;
            width: 4px;
            margin-right: 2px;
            background-color: map.get($background, $val);
            border-radius: 4px;
            animation: loading 0.6s linear infinite;
            &:nth-child(1) {
                animation-delay: 0.1s;
            }
            &:nth-child(2) {
                animation-delay: 0.2s;
            }
            &:nth-child(3) {
                animation-delay: 0.3s;
            }
        }
    }
}
@keyframes loading {
    0% {
        height: 2px;
        opacity: 30%;
    }
    50% {
        height: 20px;
        opacity: 100%;
    }
    100% {
        height: 2px;
        opacity: 30%;
    }
}

