.mat-dialog-container {
    padding: 0;
    border-radius: 8px;
    box-shadow: 0px 8px 12px 1px rgba(0, 0, 0, 0.2);
}

.cdk-overlay-dark-backdrop {
    background: rgba(0, 0, 0, 0.48);
}

.mat-dialog-title {
    display: flex;
    align-items: center;
    justify-content: space-between;
    padding: 20px 0px 20px 20px;
    margin: 0;
    .modalHeader {
        display: flex;
        align-items: center;
        gap: 8px;
        font-size: 20px;
        font-weight: 600;
    }

    .closeIcon {
        button {
            border: none;
            background: none;
